// src/App.js

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AuthForm from './components/AuthForm';
import Dashboard from './components/Dashboard';
import DishForm from './components/DishForm';
import SupplierForm from './components/SupplierForm';
import IngredientForm from './components/IngredientForm'; // Novo import

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<AuthForm />} />
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/dish-form" element={<DishForm />} />
                <Route path="/supplier-form" element={<SupplierForm />} />
                <Route path="/ingredient-form" element={<IngredientForm />} />
                <button onClick={() => navigate('/client-form')} className={styles.btnOption}>Cadastrar Cliente</button>
            </Routes>
        </Router>
    );
}

export default App;
